import React, { useEffect, useState } from 'react';
import {
    Dialog,
    DialogContent,
    DialogTitle,
    Typography,
    Chip,
    Avatar,
    IconButton,
} from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';

export default function ApptDialog({ doctorUniqId, id, dialogOpen, handleCloseDialog, selectedDate, doctorsAvailability, setSelectedStartTime, handleBooking }) {
    const [selectedDoctorInfo, setSelectedDoctorInfo] = useState(null);
    const [displayStartDate, setDisplayStartDate] = useState(new Date(selectedDate));
    const displayEndDate = new Date(displayStartDate.getTime() + 10 * 24 * 60 * 60 * 1000); // 10 days later
    const [currentSlots, setCurrentSlots] = useState([]);

    useEffect(() => {
        const doctorInfo = doctorsAvailability.find(doctor => doctor.doctorId === doctorUniqId);
        setSelectedDoctorInfo(doctorInfo);
    }, [doctorsAvailability, doctorUniqId]);

    useEffect(() => {
        // Filter available slots for the selected date and the 10th date after it
        const availableSlots = selectedDoctorInfo?.availability.flatMap(item => {
            if (item.dates[0] >= displayStartDate && item.dates[0] <= displayEndDate) {
                return item.startTimes.map(time => ({ date: item.dates[0], time }));
            }
            return [];
        }) || [];

        setCurrentSlots(availableSlots);
    }, [selectedDoctorInfo, displayStartDate, displayEndDate]);

    const convertTo12HourFormat = (time) => {
        const [hours, minutes] = time.split(":");
        const parsedHours = parseInt(hours, 10);
        const ampm = parsedHours >= 12 ? "PM" : "AM";
        const twelveHour = parsedHours % 12 || 12;
        return `${twelveHour}:${minutes} ${ampm}`;
    };

    const formatSelectedDate = (date) => {
        const startMonth = date.toLocaleString('en-US', { month: 'long' });
        const startDay = date.getDate();
        return `${startMonth} ${startDay}`;
    };

    const handleNextDays = () => {
        setDisplayStartDate(new Date(displayStartDate.getTime() + 10 * 24 * 60 * 60 * 1000)); // 10 days later
    };

    const handlePreviousDays = () => {
        setDisplayStartDate(new Date(displayStartDate.getTime() - 10 * 24 * 60 * 60 * 1000)); // 10 days earlier
    };

    return (
        <div>
            <Dialog open={dialogOpen} onClose={handleCloseDialog} fullWidth>
                <DialogTitle style={{ margin: "1rem", borderBottom: "2px grey solid", display: "flex", alignItems: "center" }}>
                    {selectedDoctorInfo ? (
                        <Avatar
                            alt={`Dr. ${selectedDoctorInfo.doctorName}`}
                            src={selectedDoctorInfo.doctorImageURL} // Replace with the actual image URL
                            style={{ marginRight: "1rem", marginTop: "-2rem", height: '5rem', width: "5rem" }}
                        />
                    ) : null}
                    <div>
                        <Typography style={{ fontSize: '18px', fontWeight: "550" }}>
                            {selectedDoctorInfo ? `Dr. ${selectedDoctorInfo.doctorName}` : "Doctor Name"}
                        </Typography>
                        <Typography style={{ fontSize: '16px' }} variant="body2">
                            {selectedDoctorInfo ? selectedDoctorInfo.specialist : "Specialist"}
                        </Typography>
                        <Typography variant="body2" style={{ color: "grey" }}>33 N Fullerton Ave Montclair NJ 07042</Typography>
                        <Typography variant="body2" style={{ color: "grey" }}>  Choose a time with Dr. Lerner that works for you</Typography>
                        <Typography variant="body3" style={{ fontWeight: "550", marginTop: "1rem", marginLeft: "-5rem" }}>
                            {selectedDate && formatSelectedDate(displayStartDate)}
                        </Typography>
                    </div>
                </DialogTitle>

                <DialogContent style={{ margin: "1rem" }}>
                    {currentSlots.length > 0 ? (
                        currentSlots.map((slot, index) => (
                            <div key={index}>
                                <Typography style={{ fontSize: '15px' }} variant="body2">
                                    {slot.date.toLocaleDateString('en-US', { month: 'short', day: 'numeric' })}
                                </Typography>
                                <Chip
                                    style={{ padding: "0.5rem", fontSize: "15px", borderRadius: "2px", margin: '0.3rem', background: "yellow" }}
                                    label={convertTo12HourFormat(slot.time)}
                                    className="mt-2"
                                    onClick={() => {
                                        setSelectedStartTime(slot.time);
                                        handleBooking(doctorUniqId, id, slot.date);
                                    }}
                                />
                            </div>
                        ))
                    ) : (
                        <Typography style={{ textAlign: "center", marginTop: "1rem" }}>
                            No Availability
                        </Typography>
                    )}
                </DialogContent>

                <div style={{ display: "flex", alignItems: "center", justifyContent: "center", marginTop: "1rem" }}>
                    <IconButton onClick={handlePreviousDays}>
                        <ArrowBackIcon />
                    </IconButton>
                    <Typography style={{ fontWeight: "bold", fontSize: "16px" }}>
                        {formatSelectedDate(displayStartDate)}
                    </Typography>
                    <IconButton onClick={handleNextDays}>
                        <ArrowForwardIcon />
                    </IconButton>
                </div>
            </Dialog>
        </div>
    );
}
